import React from 'react';
import './sass/sub3.scss'
import axios from 'axios';
import Sub3ChildComponent from './Sub3ChildComponent';
import { WrapContext } from '../wrapContext/WrapContext';

export default function Sub3Component (){

    const {currentViewProduct} = React.useContext(WrapContext)

const [state, setState] = React.useState({
    category: false,
    brand : false,
    price : false,
    type : false,
    benefit : false,
    excliude : false,

    issub1 : true,
    issub2 : true,
    issub3 : true,
    issub4 : true,
    issub5 : true,
    issub6 : true,

    comment : false,
    슬라이드:[]
})
const [state2, setState2] = React.useState({

    manyProduct : false,
    EveryAbc : true,
    every:true,
    ㄱ:false,
    ㄴ:false,
    ㄷ:false,
    ㄹ:false,
    ㅁ:false,
    ㅂ:false,
    ㅅ:false,
    ㅇ:false,
    ㅈ:false,
    ㅊ:false,
    ㅋ:false,
    ㅌ:false,
    ㅍ:false,
    ㅎ:false,
    az:false,
    etc:false,
})

const onClickManyProduct = (e) =>{
    e.preventDefault();
    setState2({
        ...state2,
        manyProduct: true,
        EveryAbc : false,
    })
}
const onClickAbc = (e) =>{
    e.preventDefault();
    setState2({
        ...state,
        EveryAbc : true,
        manyProduct: false,
        every : true
    })
}
const onClickEveryThing = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        EveryAbc : true,
        every:true
    })
}
const onClickA = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㄱ: true,
        EveryAbc : true
    })
}
const onClickB = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㄴ: true,
        EveryAbc : true
    })
}
const onClickC = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㄷ: true,
        EveryAbc : true
    })
}
const onClickD = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㄹ: true,
        EveryAbc : true
    })
}
const onClickE = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㅁ: true,
        EveryAbc : true
    })
}
const onClickF = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㅂ: true,
        EveryAbc : true
    })
}
const onClickG = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㅅ: true,
        EveryAbc : true
    })
}
const onClickH = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㅇ: true,
        EveryAbc : true
    })
}
const onClickI = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㅈ: true,
        EveryAbc : true
    })
}
const onClickJ = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㅊ: true,
        EveryAbc : true
    })
}
const onClickK = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㅍ: true,
        EveryAbc : true
    })
}
const onClickL = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        ㅎ: true,
        EveryAbc : true
    })
}
const onClickM = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        az: true,
        EveryAbc : true
    })
}
const onClickN = (e)=>{
    e.preventDefault();
    setState2({
        ...state,
        etc: true,
        EveryAbc : true
    })
}

const onClickcategory =(e)=>{
    e.preventDefault();
    setState({
        ...state,
        category : !state.category,
        issub1:!state.issub1
    })
}
const onClickBrand =(e)=>{
    e.preventDefault();
    setState({  
        ...state,
        brand : !state.brand,
        EveryAbc : !state.EveryAbc,
        manyProduct : !state.manyProduct,
        issub2:!state.issub2
    })
}
const onClickPrice =(e)=>{
    e.preventDefault();
    setState({
        ...state,
        price : !state.price,
        issub3:!state.issub3
    })
}
const onClickType =(e)=>{
    e.preventDefault();
    setState({
        ...state,
        type : !state.type,
        issub5:!state.issub5
    })
}
const onClickBenefit =(e)=>{
    e.preventDefault();
    setState({
        ...state,
        benefit : !state.benefit,
        issub4:!state.issub4
    })
}
const onClickExclude =(e)=>{
    e.preventDefault();
    setState({
        ...state,
        excliude : !state.excliude,
        issub6:!state.issub6
    })
}

const onMouseEnterComment = ()=>{
    setState({
        comment:true
    })
}
const onMouseLeaveComment = ()=>{
    setState({
        comment:false
    })
}

axios({
    url : './data/sub/sub1.json',
    method : 'GET'
})
.then((res)=>{
    setState({
        ...state,
        슬라이드 : res.data.슬라이드
    })
})
.catch((err)=>{
})

    return (
        <div id='sub3'>
            <div className="container">
                <div className="main-img">
                    <a href="!#"><img src="./img/sub1/K55OxyfwVlSr1BigzjhQSKAIzi0WNulp0EnVvnMQ.jpg" alt="" /></a>
                </div>
                <div className="title">
                    <h2>알뜰쇼핑</h2>
                </div>
                <div className="content">
                    <div className="left">
                        <div className="col-gap">
                            <div className="top">
                                <strong>필터</strong>
                                <a href="!#">
                                    <img src="./img/sub1/reset.svg" alt="" />
                                    <em>초기화</em>
                                </a>
                            </div>
                            <div className="category">
                                    <nav>
                                        <div onClick={onClickcategory} className="title-box">
                                            <a href="!#">카테고리</a>
                                            <img className={state.category ? 'on' : ''} src="./img/sub1/next_arrow.svg" alt="" />
                                        </div>
                                        <div className={`sub sub1${state.issub1 ? ' on' : ' off'}`}>
                                            <ul>
                                                <li>
                                                    <label>
                                                        <input type="checkbox" id='sub-1' name='sub-1' value='국·반찬·메인요리' />국·반찬·메인요리
                                                        <em>27</em>
                                                    </label>
                                                </li>
                                                <li>
                                                    <label>
                                                        <input type="checkbox" id='sub-2' name='sub-2' value='간식·과자·떡' />간식·과자·떡
                                                        <em>25</em>
                                                    </label>
                                                </li>
